message:
A maçonaria e os evangélicos/ protestantes parte 1

Um próprio pastor evangélico maçom dizendo o seguinte;

Os maçons abriram suas lojas para que os primeiros pastores fizessem suas primeiras pregações no Brasil 

Os maçons se uniram com os prosterantes e ao partido repúblicano na proclamação da República na derrubada do império 

Não sou eu que estou dizendo mas sim um pastor maçom

